import './App.css';
import React from 'react'
import Navbar from './myComponent/Navbar';
import News from './myComponent/News';
import Footer from './myComponent/Footer';

const App=()=> {

    return (
      <div>
         <div
        style={{
          position: "fixed",
          top:0,
          left: 0,

          right: 0,
          backgroundColor: "green"
        }}
      ><Navbar/></div>

        <News size={6}/>

        <Footer/>
      </div>

    )

}
export default App;
